import React, { Component } from 'react'
import { Switch, Route, Redirect } from 'react-router-dom'
import './App.css';
import BgEffect from './components/effect/BgEffect'
import Navbar from './components/navbar/Navbar'

function App() {
  return (
    <>

      <Navbar />

      <BgEffect>

      </BgEffect>
      <Switch>
        <Route path="/" exact render={() => <h1>HOLA GONZALO</h1>} />
        <Route path="/hola" exact render={() => <h1>Adios GONZALO</h1>} />

        </Switch>
        <Footer />
    </>
  );
}

export default App;
